import React from "react";
import "./artist-card.css";

class ArtistCard extends React.Component {
  render() {
    return (
      <div>
        <img
          src="https://pbs.twimg.com/profile_images/378800000134508566/7497cb5935c314861f16fbf3828157b3.jpeg"
          alt=""
        />
        <p>Gustavo Cerati</p>
      </div>
    );
  }
}

export default ArtistCard;
